{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/seifhkungulio/demand-forecasting-for-bike-sharing?scriptVersionId=214932546\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown"},{"cell_type":"markdown","id":"eaf9231a","metadata":{"papermill":{"duration":0.007729,"end_time":"2024-12-26T23:15:25.81663","exception":false,"start_time":"2024-12-26T23:15:25.808901","status":"completed"},"tags":[]},"source":["# **Optimizing Demand Forecasting for Bike Sharing System**"]},{"cell_type":"markdown","id":"a09e9ee3","metadata":{"papermill":{"duration":0.006745,"end_time":"2024-12-26T23:15:25.831737","exception":false,"start_time":"2024-12-26T23:15:25.824992","status":"completed"},"tags":[]},"source":["## **Business Understanding**"]},{"cell_type":"markdown","id":"b0663913","metadata":{"papermill":{"duration":0.00622,"end_time":"2024-12-26T23:15:25.844214","exception":false,"start_time":"2024-12-26T23:15:25.837994","status":"completed"},"tags":[]},"source":["### **Problem Statement**\n","\n","The Washington, D.C. bike-sharing program plays a vital role in the city’s transportation ecosystem. However, effective demand forecasting remains a challenge, particularly during holidays. Accurate predictions are critical for balancing supply and demand, minimizing operational inefficiencies, and ensuring customer satisfaction. This project aims to build a predictive model using machine learning techniques to classify holiday usage patterns based on historical and environmental data."]},{"cell_type":"markdown","id":"540eb5c3","metadata":{"papermill":{"duration":0.006192,"end_time":"2024-12-26T23:15:25.856573","exception":false,"start_time":"2024-12-26T23:15:25.850381","status":"completed"},"tags":[]},"source":["## **Data Understanding**\n","\n","### **Data Description**\r\n","- **Rows and Columns:** The dataset consists of 10,886 records (rows) and 12 variables (columns).\r\n","- **Variables Overview:**\r\n","  - **datetime:** Timestamp of the record (object type).\r\n","  - **season:** Numerical representation of the season (1: Winter, 2: Spring, 3: Summer, 4: Fall).\r\n","  - **holiday:** Binary indicator of whether the day is a holiday (0: No, 1: Yes).\r\n","  - **workingday:** Binary indicator of whether the day is a working day (0: No, 1: Yes).\r\n","  - **weather:** Categorical indicator for weather conditions (1: Clear, 2: Mist, etc.).\r\n","  - **temp:** Recorded temperature in Celsius.\r\n","  - **atemp:** Perceived temperature (\"feels like\") in Celsius.\r\n","  - **humidity:** Relative humidity in percentage.\r\n","  - **windspeed:** Wind speed in meters per second.\r\n","  - **casual:** Count of casual (non-registered) bike rentals.\r\n","  - **registered:** Count of registered bike rentals.\r\n","  - **count:** Total number of bike rentals (target variable for prediction).\r\n","\r\n","### **Data Quality Assessment**\r\n","- **Completeness:** No missing values are observed across the columns, ensuring complete data.\r\n","- **Data Types:** Most variables are appropriately typed (e.g., integers for categorical variables, floats for continuous ones), except for \"datetime\", which can be converted to a datetime type for time-based analysis.\r\n","\r\n","### **Preliminary Observations**\r\n","- The data is time-series in nature, as indicated by the \"datetime\" variable.\r\n","- Variables such as \"season\", \"holiday\", and \"workingday\" provide categorical contextual information.\r\n","- Continuous variables like \"temp\", \"atemp\", \"humidity\", and \"windspeed\" may play a role in predicting bike rentals (\"count\")."]},{"cell_type":"markdown","id":"d6e08141","metadata":{"papermill":{"duration":0.006352,"end_time":"2024-12-26T23:15:25.869204","exception":false,"start_time":"2024-12-26T23:15:25.862852","status":"completed"},"tags":[]},"source":["### **Data Dictionary**\n","\n","| **Variable** | *