ber of registered users             | Integer     | Must be non-negative, with a maximum of 886.                                     |\r\n","| count        | Total number of bike rentals           | Integer     | Must equal casual + registered, and be non-negative.                            |\n"]},{"cell_type":"markdown","id":"a8e32e49","metadata":{"papermill":{"duration":0.006402,"end_time":"2024-12-26T23:15:25.88186","exception":false,"start_time":"2024-12-26T23:15:25.875458","status":"completed"},"tags":[]},"source":["## **Data Preparation**"]},{"cell_type":"markdown","id":"984352b3","metadata":{"papermill":{"duration":0.006799,"end_time":"2024-12-26T23:15:25.894848","exception":false,"start_time":"2024-12-26T23:15:25.888049","status":"completed"},"tags":[]},"source":["### **Install Packages & Load Dataset**"]},{"cell_type":"code","execution_count":1,"id":"026482a9","metadata":{"execution":{"iopub.execute_input":"2024-12-26T23:15:25.913376Z","iopub.status.busy":"2024-12-26T23:15:25.91085Z","iopub.status.idle":"2024-12-26T23:15:29.821944Z","shell.execute_reply":"2024-12-26T23:15:29.819471Z"},"papermill":{"duration":3.9239,"end_time":"2024-12-26T23:15:29.824965","exception":false,"start_time":"2024-12-26T23:15:25.901065","status":"completed"},"tags":[]},"outputs":[],"source":["# Install necessary packages if not installed\n","if (!requireNamespace(\"e1071\", quietly = TRUE)) {\n","  install.packages(\"e1071\")\n","}\n","if (!requireNamespace(\"caret\", quietly = TRUE)) {\n","  install.packages(\"caret\")\n","}\n","if (!requireNamespace(\"ggplot2\", quietly = TRUE)) {\n","  install.packages(\"ggplot2\")\n","}\n","if (!requireNamespace(\"dplyr\", quietly = TRUE)) {\n","  install.packages(\"dplyr\")\n","}\n","if (!requireNamespace(\"corrplot\", quietly = TRUE)) {\n","  install.packages(\"corrplot\")\n","}"]},{"cell_type":"code","execution_count":2,"id":"de561e27","metadata":{"execution":{"iopub.execute_input":"2024-12-26T23:15:29.879172Z","iopub.status.busy":"2024-12