                \n"]}],"source":["# Compute the confusion matrix\n","conf_matrix <- confusionMatrix(test_predictions, true_holiday)\n","print(conf_matrix)"]},{"cell_type":"markdown","id":"6e912f3f","metadata":{"papermill":{"duration":0.01302,"end_time":"2024-12-26T23:18:19.844821","exception":false,"start_time":"2024-12-26T23:18:19.831801","status":"completed"},"tags":[]},"source":["## **Conclusions**\n","\n","1. **Model Development**: An SVM model was built to predict holidays, using predictors like season and working day. A grid search was used to optimize hyperparameters, resulting in a cost of 100 and gamma of 1.\r\n","\r\n","2. **Forecasting**: The optimized model was used to generate predictions on a test dataset, and its performance was evaluated with a confusion matrix.\r\n","\r\n","3. **Performance**:\r\n","   - High accuracy (97.27%) and sensitivity (99.91%) indicate strong performance for the majority class (`No Holiday`).\r\n","   - Low specificity (6.67%) highlights poor prediction of the minority class (`Holiday`), revealing class imbalance.\r\n","   - Balanced accuracy (53.36%) and a low kappa statistic (0.1195) further confirm the imbalance issue.\r\n","\r\n","4. **Insights**:\r\n","   - Strengths: High accuracy and effective parameter tuning for the majority class.\r\n","   - Weaknesses: The model struggles with the minority class, making it less reliable for practical use.\r\n","\r\n","5. **Recommendations**:\r\n","   - Address class imbalance with resampling techniques or class weights.\r\n","   - Explore additional features, alternative kernels, or different classification models.\r\n","   - Use metrics like F1-Score and Precision to better assess model performance.\r\n","\r\n","While promising, the model requires further optimization for improved holiday prediction."]}],"metadata":{"kaggle":{"accelerator":"none","dataSources":[{"datasetId":6037772,"sourceId":9848500,"sourceType":"datasetVersion"}],"dockerImageVersionId":30749,"isGpuEnabled":fals